import React from "react";
import CardList from "./CardList.js";
import SearchBox from "./SearchBox.js";
import {robots} from "./robots.js";

const state = {
    robots: robots,
    searchfield: ''
}

class App extends React.Component {
    render() {
        return (
            <React.Fragment>
                <h1>RoboFriends</h1>
                <SearchBox/>
                <CardList robots={robots}/>
            </React.Fragment>
        );
    }
}

export default App;
